import React from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";

// @material-ui/icons

// core components
import Header from "components/Header/Header.js";
import Footer from "components/Footer/Footer.js";
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import Button from "components/CustomButtons/Button.js";
import HeaderLinks from "components/Header/HeaderLinks.js";
import Parallax from "components/Parallax/Parallax.js";

import styles from "assets/jss/material-kit-react/views/pageStyle";
import img from "assets/img/Heiskanen_Katriina_2_1.jpg";

// Sections for this page
import ProductSection from "./LandingPage/Sections/ProductSection.js"
import TeamSection from "./LandingPage/Sections/TeamSection.js";
import WorkSection from "./LandingPage/Sections/WorkSection.js";

const dashboardRoutes = [];

const useStyles = makeStyles(styles);

export default function AboutMe(props) {
  const classes = useStyles();
  const { ...rest } = props;
  return (
    <div className={classNames(classes.main, classes.mainRaised)}>
        <div className={classes.container}>
        <div className={classes.section}>
      <GridContainer justify="center">
        <GridItem xs={12} sm={12} md={8}>
          <h2 className={classes.title}>Hi, I'm Katriina!</h2>
          <h5 className={classes.description}>
          For me, the most important thing in the IT field is the possibility to combine very different kinds of skills: logic and creativity, management and leadership, research and implementation. The most interesting projects require applying knowledge from different fields to one task.
          <br /> I am currently finilizing my Master of Science (in Technology) degree at Aalto University in the Information Networks study programme. I am majoring in ICT in Business, and studying Web Technologies as my minor. In my Bachelor's degree, I studied Media Technology, and Work Psychology and Leadership. I have gathered a wide variety of knowledge and skills during my years at the university and work life.
            <br />I set my goals high, and am determined to reach them. I am not afraid to put in hours of planning and hard work to achieve things in both professional and personal life. My dearest hobbies are ultra-distance cycling and bikebacking, which require long hours of structured training, systematic planning and nerves of steel.
          </h5>
        </GridItem>
        <GridItem xs={12} sm={12} md={6} className={classes.itemGrid}>
                <img src={img} alt="..." className={imageClasses} />
              </GridItem>
      </GridContainer>
    </div>
        </div>
      </div>
  );
}
